window.bookSummaryJSON = "<p>Jack Noble. Assassin for hire. Spy. Thief. He makes no mistakes. Passes no judgement. Feels no remorse. So why does he stop to help a lost child moments before he's supposed to complete a deal with one of the East Coast's top crime bosses? </p> <p>A simple decision that places Jack in unfamiliar territory. He's become the hunted and finds himself in a race against time to save those closest to him. <i>Noble Intentions: Season One</i> is a fast-paced, suspenseful thriller full of underworld crime and government secrets from <i>USA Today</i> best-selling author L. T. Ryan. Fans of Jack Reacher, Jason Bourne, and Mitch Rapp will likely enjoy this series. Season one is a compilation of episodes one through five. Seasons two, three, and four, as well as four Jack Noble novels, are now available. </p>"; 
